import React from "react";
import { NavLink } from "react-router-dom";
import img from "../src/image/sad2.png"
import Commom from './Commom';

const About = () => {

    return (
      <>
        <Commom 
        name="Wellcome To Commom Page" 
        imgsrc={img} 
        visit="/contact"
         btnName ="Contact Now"/>
      </>
    )
  }
  export default About;
